import React from "react";
import { Card } from "./card/Card";
import {Button} from "../../components/button";

const Dashboard = () => {
  return (
    <div className="d-flex justify-content-center align-items-center h-100">
      <Card />
      <Button />
    </div>
  );
};

export default Dashboard;
